    case Key of
      8 ->
	  'd_field_mvccpb.Event_type'(Rest, 0, 0, F@_1, F@_2,
				      F@_3, TrUserData);
      18 ->
	  'd_field_mvccpb.Event_kv'(Rest, 0, 0, F@_1, F@_2, F@_3,
